function Footer() {
	return (
		<footer className='styles.'>
			<p>
				This website is created as part of Hlsolutions program. The materials contained on this website are
				provided for general information only and do not constitute any form of advice. HLS assumes no
				responsibility for the accurancy of any particular statement and accepts no liability for any loss or
				damage which may arise from reliance on the information contained on this site.
			</p>
			<p>Copyright 2021 HLS</p>
		</footer>
	);
}
export default Footer;
